import React from 'react';
import logo from './log2.png';
import './index.css';
import profile from './patient.png'
import appointment from ''
function main(){
  return(  
    <div>
       <header>
        <img src={logo} alt="l"  />
        <h1>MEDIsync</h1>
        <p>logout</p></header>
    
   <div className='navbar'>
  
    <div className='navs' id='profile'>Profile </div>
    <div className='navs' id='appointment'>Appointment Allocation</div>
    <div className='navs' id='history'>Medical History</div>
    <div className='navs' id='help'>Help</div>
  
  </div>

    </div>
  
   
  )
}
export default main;
